INSERT INTO `posts` (`id`, `title`, `content`, `created`, `modified`, `user_id`) VALUES
(1, 'Bienvenue', 'Bienvenue sur le nouveau site de gestion de partitions numériques pour un accès facile à toutes vos partitions d''orchestres et de cours.\r\n\r\nBonne découverte!', '2014-12-01 13:56:57', '2014-12-01 23:24:16', 3),
(3, 'Suivez l''activité musicale de l''école de musique et de l''harmonie', 'Grâce à un calendrier, vous pouvez suivre les différentes activités musicales de l''école : répétitions, auditions de classe et spectacle. (Code couleur : bleu pour école de musique / rouge pour harmonie)', '2014-12-20 00:19:27', '2014-12-20 00:20:42', 3),
(4, 'Trouver ses partitions, les enregistrer ou imprimer', 'Pour afficher ses partitions, cliquez sur "My scores". Des onglets apparaîtront au-dessus du calendrier situé à droite. Cliquez alors sur les différentes arborescence. Attention : l''affichage des partitions peut prendre un certain temps... Une fois la partition affichée, vous pourrez l''enregistrer ou l''imprimer en vous dirigeant en bas à droite de la partition.', '2015-01-09 11:06:32', '2015-01-09 11:07:46', 3);
